import React from "react";
import Box from "../../components/Box";
import "./home.css";
const HomePage = () => {
  return (
    <div>
      <div className="container">
        <div className="boxes">
          <div className="box">
            <Box
              src="https://s3.ap-south-1.amazonaws.com/media.creditap.in/production/v2.0/public/products/fd0b8d25-4c2c-4640-9a54-93c0c3a0fffb.svg"
              header="SHORT TERM SCHOOL FEES FINANCING"
            />
            <Box src="https://s3.ap-south-1.amazonaws.com/media.creditap.in/production/v2.0/public/products/c9f2ba71-3b6d-437c-b542-46deb48e8dce.svg" 
            header='SHORT TERM COLLEGE/HIGHER EDUCATION'
            />
            <Box src="https://s3.ap-south-1.amazonaws.com/media.creditap.in/production/v2.0/public/products/b79e07b6-d2b9-4cfc-b023-63a7497463a7.svg" 
            header="SHORT TERM CAREER COACHING"/>
            <Box src="https://s3.ap-south-1.amazonaws.com/media.creditap.in/production/v2.0/public/products/c9f2ba71-3b6d-437c-b542-46deb48e8dce.svg" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
